  },
  "description": {
    "nb": "Bordingsfelt er angitt som et geografisk punkt i sjøkartetfastsatt av Kystverket. Bordingsposisjonene er også blant annet angitt i den Norske Los, bind 1. Bordingsposisjonen kan avvike fra angitt bordingspunkt,etter rådende værforhold, i henhold til losensanvisninger. Bordingsplassene er lokalisert i forhold til de lokale losstasjonene."
  },
