  "title": {
    "nb": "Navigasjonsinstallasjon"
  },
  "description": {
    "nb": "Kystverket administrerer et system av innretninger for navigasjonsveiledning i Norge. Dette systemet består av innretninger drevet av Kystverket, innretninger drevet av kommunale havner og private innretninger drevet av andre.Innretninger for navigasjonsveiledninggir visuelle og elektroniske signaler som er lagt til rette for å være til hjelp i navigasjonsprosessen for aktsomme sjøfarende. Det er imidlertid ikke hensikten å gjøre det mulig for sjøfarende å identifisere enhver båe eller grunne eller hindring for sjøtrafikken som finnes i norske farvann som ellers er farbare for skip. Derimot skal Kystverket sørge for en fornuftig merking av farvannet i den utstrekning som ressursene tillater."
  },
