  "title": {
    "nb": "IUA - Interkommunale utvalg mot akutt forurensning"
  },
  "description": {
    "nb": "Den kommunale beredskapen er basert på risikovurderinger av normal virksomhet i kommunen. Landets kommuner er organisert i 32 beredskapsregioner. Et Interkommunalt utvalg for akutt forurensning (IUA) i hver region ivaretar beredskaps- og aksjonsplikten. Denne interkommunale beredskapen er dimensjonert for å håndtere mindre, akutte utslipp. Forurensningshendelser som er, eller utvikler seg til å bli, av en slik størrelse at de blir for store for et IUA å håndtere, vil bli overtatt av Kystverket (\"Statlig aksjon\")."
  },
