  "description": {
    "nb": "Stortinget bevilger midler over statsbudsjettet til at Kystverket skal gjøre investeringer i statlige fiskerihavner. Utbygging av fiskerihavner skjer i henhold til de kriterier og prosesser som er trukket opp i St. meld. nr. 46 (1999-2000) Nasjonal transportplan 2002-2011, St.meld. nr. 46 (1996-97) Havner og infrastruktur for sjøtransport og St.meld. nr. 44 (1992-93) Om fiskerihavnepolitikken. Nye anlegg tas opp til bevilgning som følge av prioriteringer i Kystverkets Handlingsprogram, utarbeidet på grunnlag av prosessen med Nasjonal transportplan."
  },
